const NavBar = () => {
    return <div className={styles.main}>
        <ul>
        <li><a href="#projects">Projects</a></li>
        <li><a href="#experiences">Experiences</a></li>
        <li><a href="#acheive">Experiences</a></li>
    </ul>
    </div>
}

export default NavBar;
